import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import './NavBar.css';
import 'tailwindcss/tailwind.css';

import logo from '../logo.png';


class NavBar extends Component {

	render(){

		return (
			<div className='ml-2 mt-2 mr-2 text-gray- text-3xl font-mono bg-black grid grid-flow-row grid-rows-1 grid-cols-6 place-items-center'>
				

				<img src={logo} id='navbar-logo' className="App-logo w-80" alt="logo" />

				<Link to="/" className="relative">  <a> Home </a> </Link> 
				<Link to="/me" className=""> <a> Me </a> </Link>

				<Link to="/mint" className=""> <a> Mint </a> </Link>
				<Link to="/search" className=""> <a> Search NFTs </a> </Link>

			</div>

		);

	}
}

export default NavBar;

